import React, { useContext, useState } from 'react';
import { NavHashLink as NavLink } from 'react-router-hash-link';
import Fade from 'react-reveal/Fade';
import { IoMenuSharp, IoHomeSharp } from 'react-icons/io5';
import { HiDocumentText } from 'react-icons/hi';
import { BsFillGearFill } from 'react-icons/bs';
import { MdPhone } from 'react-icons/md';
import { FaUser, FaFolderOpen } from 'react-icons/fa';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CloseIcon from '@material-ui/icons/Close';

import './Navbar.css';
import { headerData } from '../../data/headerData';
import { ThemeContext } from '../../contexts/ThemeContext';

function Navbar() {
    const { theme, setHandleDrawer } = useContext(ThemeContext);
    const [open, setOpen] = useState(false);

    const handleDrawerOpen = () => {
        setOpen(true);
        setHandleDrawer();
    };

    const handleDrawerClose = () => {
        setOpen(false);
        setHandleDrawer();
    };

    const useStyles = makeStyles((t) => ({
        // ... [existing styles]
        // Add or modify styles if needed
    }));

    const classes = useStyles();

    const shortname = (name) => {
        if (name.length > 12) {
            return name.split(' ')[0];
        } else {
            return name;
        }
    };

    return (
        <div className='navbar'>
            <div className='navbar--container'>
                <h1 style={{ color: theme.secondary }}>
                    {shortname(headerData.name)}
                </h1>

                <IoMenuSharp
                    className={classes.navMenu}
                    onClick={handleDrawerOpen}
                    aria-label='Menu'
                />
            </div>

            <Drawer
                variant='temporary'
                onClose={(event, reason) => {
                    if (reason !== 'backdropClick' && reason !== 'escapeKeyDown') {
                        handleDrawerClose();
                    }
                }}
                anchor='left'
                open={open}
                classes={{ paper: classes.MuiDrawer }}
                className='drawer'
                disableScrollLock={true}
            >
                <div className='div-closebtn'>
                    <CloseIcon
                        onClick={handleDrawerClose}
                        onKeyDown={(e) => {
                            if (e.key === ' ' || e.key === 'Enter') {
                                e.preventDefault();
                                handleDrawerClose();
                            }
                        }}
                        className={classes.closebtnIcon}
                        role='button'
                        tabIndex='0'
                        aria-label='Close'
                    />
                </div>
                <br />

                <div onClick={handleDrawerClose}>
                    <div className='navLink--container'>
                        {/* Existing links */}
                        {/* ... [existing Fade and NavLink components] */}

                        {/* New links for the additional headings */}
                        {[
                            { name: 'Who I Am', icon: <FaUser /> },
                            { name: 'Education', icon: <HiDocumentText /> },
                            { name: 'Skills', icon: <BsFillGearFill /> },
                            { name: 'Experience', icon: <FaFolderOpen /> },
                            { name: 'Projects', icon: <FaFolderOpen /> },
                            { name: 'Achievements', icon: <FaFolderOpen /> },
                            { name: 'Leadership Roles', icon: <FaFolderOpen /> },
                            { name: 'Publications and Patent', icon: <FaFolderOpen /> },
                            { name: 'Gallery', icon: <FaFolderOpen /> },
                            { name: 'Contacts', icon: <MdPhone /> },
                        ].map((item, index) => (
                            <Fade left key={index}>
                                <NavLink
                                    to={`/#${item.name.toLowerCase().replace(/ /g, '')}`}
                                    smooth={true}
                                    spy={true}
                                    duration={2000}
                                >
                                    <div className={classes.drawerItem}>
                                        {item.icon}
                                        <span className={classes.drawerLinks}>
                                            {item.name}
                                        </span>
                                    </div>
                                </NavLink>
                            </Fade>
                        ))}
                    </div>
                </div>
            </Drawer>
        </div>
    );
}

export default Navbar;
